import { FaEnvelope, FaPhone } from "react-icons/fa";
import "./Terms.css"; // ✅ import CSS file

export default function Terms() {
  const termsText = [
    "Payment covers only visiting charges. Food, travel, stay excluded.",
    "Non-refundable unless specified in writing.",
    "Booking confirmed only after Razorpay payment.",
    "Additional costs borne by customer.",
    "Payments secure via Razorpay. No card details stored.",
    <>
      Dispute Resolution: Contact <FaEnvelope className="icon" />
      <a href="mailto:events@franmaxindia.com" className="link">
        events@franmaxindia.com
      </a>{" "}
      or <FaPhone className="icon" /> +91 94038 90794
    </>,
    "We may update terms without prior notice.",
  ];

  return (
    <div className="terms-container">
      <h1 className="terms-title">No Refund Policy</h1>
      <ul className="terms-list">
        {termsText.map((term, index) => (
          <li key={index} className="terms-item">
            {term}
          </li>
        ))}
      </ul>
    </div>
  );
}
